import React from 'react';
import { Provider } from 'react-redux';
import { BrowserRouter as Router, Route, Routes, Navigate, Link } from 'react-router-dom';
import store from './store';
import AuthComponent from './components/AuthComponent';
import Blog from './components/Blog';
import Login from './components/Login';
import LoginNew from './components/LoginNew';
import HomePage from './components/HomePage';
import StudentsDetails from './components/StudentsDetails';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import ProductList from './components/ProductList';
import Cart from './components/Cart';
import Payment from './components/Payment';
import SignupForm from './components/SignupForm';
import CancelPage from './components/CancelPage';
const App = () => {
  const isAuthenticated = true; // Replace with actual authentication logic

  return (
    <Provider store={store}>
      <Router>
        <div className="App container mt-5">
          <h1 className="text-center mb-4">My Redux App</h1>

          {!isAuthenticated ? (
            <AuthComponent />
          ) : (
            <div>
              <nav className="mb-4">
                <ul className="nav nav-pills justify-content-center">
                <li className="nav-item">
                    <Link to="/Login" className="nav-link">
                    Login
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link to="/LoginNew" className="nav-link">
                    LoginNew
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link to="/students" className="nav-link">
                      Students Details
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link to="/blog" className="nav-link">
                      Blog
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link to="/shoppingcart" className="nav-link">
                    Shopping Cart
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link to="/SignupForm " className="nav-link">
                    SignupForm 
                    </Link>
                  </li>
                </ul>
              </nav>
              <Routes>
                <Route path="/students" element={<StudentsDetails />} />
                <Route path="/blog" element={<Blog />} />
                <Route path="/Login" element={<Login />} />
                <Route path="/LoginNew" element={<LoginNew />} />
                <Route path="/HomePage" element={<HomePage />} />
                <Route path="/shoppingcart" element={<ProductList />} />
                <Route path="/Payment" element={<Payment />} />
                <Route path="/SignupForm" element={<SignupForm />} />
                
                
              </Routes>
            </div>
          )}
        </div>
      </Router>
    </Provider>
  );
};

export default App;
